import json

def evaluate_claim():
    # load table from naturalized
    with open('table.json') as f:
        data = json.load(f)

    party_with_21_total_members = None
    total_member_count_of_party_with_fewest_total_members = float('inf')

    for row_index, row in enumerate(data):
        if row['total'] == 21:
            party_with_21_total_members = row
        elif row['total'] < total_member_count_of_party_with_fewest_total_members:
            total_member_count_of_party_with_fewest_total_members = row['total']

    if total_member_count_of_party_with_fewest_total_members != float('inf') and total_member_count_of_party_with_fewest_total_members > 0:
        member_difference = party_with_21_total_members['total'] - total_member_count_of_party_with_fewest_total_members
        # print(party_with_21_total_members)
        if member_difference == 18:
            return {
                "answer": "TRUE",
                "relevant_cells": [
                    {"row_index": 0, "column_name": "Total"},
                    {"row_index": int(total_member_count_of_party_with_fewest_total_members) - 1, "column_name": "Total"}
                ]
            }
    else:
        return {
            "answer": "FALSE",
            "relevant_cells": [
                {"row_index": 0, "column_name": "Total"},
                {"row_index": int(total_member_count_of_party_with_fewest_total_members) - 1, "column_name": "Total"}
            ]
        }

print(evaluate_claim())

